Прем'єр-міністр — перший, головний міністр, голова уряду в сучасних державах. В деяких державах вибирається на всенародних виборах, в інших затверджується парламентом після подання голови держави; або призначається головою держави.
Прем'єр-міні́стр призначає й відстороняє від посади міністрів, керує повсякденною діяльністю уряду, очолює адміністративний апарат. Як правило, прем'єр-міністр — лідер політичної партії, що має більшість у парламенті, або лідер партійної коаліції, і керує фракцією парламентської більшості.
У різних державах ця посада має різну назву. Окремі приклади наведені нижче:
⁕ Франція — Прем'єр-міністр;
⁕ Велика Британія — Прем'єр міністр;
⁕ Італія — Голова Ради Міністрів,;
⁕ Іспанія — Голова уряду;
⁕ Чехія — Прем'єр;
⁕ Німеччина — Федеральний канцлер Німеччини;
⁕ Австрія — Федеральний канцлер Австрії;
⁕ Ірландія — Тішок.

Vāra ir Francijas departaments, viens no sešiem Provansas-Alpu-Azūra Krasta reģiona departamentiem. Tas ir viens no pirmajiem 83 departamentiem, kas tika izveidoti franču revolūcijas laikā 1790. gada 4. martā. Tā platība ir 5973 km², bet iedzīvotāju skaits 2009. gadā bija nedaudz vairāk nekā 1 miljons. Vāras administratīvais centrs ir Tulona. Departaments administratīvi sīkāk dalās trijos apgabalos. Tie ir šādi:
⁕Arrondissement de Brignoles;
⁕Arrondissement de Draguignan;
⁕Tulonas apgabals.
